import React from 'react'
import { Link } from 'react-router-dom';
import './navigationButton.css'
import './theme.css'
import './irei_styles.css'

class NavigationButton extends React.Component {
    render() { 
        return ( 
            <Link to={this.props.destinationLink} state={{ from: "Burgermenu"}} 
                    className="navigation-button mdl-button mdl-js-button mdl-button--raised mdl-js-ripple-effect mdl-button--accent">
                {props.destination}
            </Link>
         );
    }
}

export default NavigationButton;
